export default function reducer(state, action) {
  console.log(action);
  switch (action.type) {
    case "SELECT_GAME":
      console.log(action.game);
      return {
        ...state,
        selectedGame: action.game
      };
      break;
    default:
      return state;
      break;
  }
}
